import React from 'react';
import '../App.css';
import { Link } from 'react-router-dom';  

const Header = () => {
  return (
    <header className="header">
      <h1>Chien Huang</h1>
      <nav className="nav">
        <ul className="nav-links">
          <li>
            <Link to="/">Home</Link>  
          </li>
          <li>
            <Link to="/about">About Me</Link>  
          </li>
          <li>
			      <Link to="/reflection">WIL Reflection</Link>
		      </li>
          <li><a href="#skills">Technical Skill</a></li>
          <li><a href="#ethic">Ethics & Accountability</a></li>
          <li><a href="#artefact">Additional Artefact</a></li>
          <li><a href="#contact">Contact Me</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
